import React from 'react';
import './App.css';
import task from './images/download.png';

function Header() {
  return (
    <div style={{marginTop:'10px'}}>
      <div style={{float:'right',display:'inline'}}>
        <img src={task} style={{height:'50px',width:'50px'}}></img>
        <p> Task Manager </p>
      </div>
      <div>
      <hr/>
      </div>

    </div>
  );
}

export default Header;
